  "text" : "\uD615\uBC95\uC758 \uAF43(?)\uC740 \uC5ED\uC2DC \uB17C\uB9AC\uC758 '\uCD1D\uB860'\uC774\uB77C \uC0DD\uAC01\uB418\uC9C0\uB9CC, \uB2E8\uC21C\uD788 \uD765\uBBF8 \uC704\uC8FC\uB85C \uC811\uADFC\uD558\uB824 \uD558\uC2DC\uB294 \uBD84\uB4E4\uAED8 \uCD1D\uB860\uC740 \uC880 \uBD80\uB2F4\uC2A4\uB7EC\uC6B4 \uAC83 \uAC19\uACE0.. (\uCD94\uCC9C\uD55C \uCC45\uC744 \uB05D\uAE4C\uC9C0 \uBCF4\uC2E0 \uBD84\uC774 \uC5C6\uC5B4\uC11C \uC8C4\uC1A1\uD569\uB2C8\uB2E4\u314B\u314B)\n\n\uADF8\uB798\uC11C \uC774\uC81C\uB294 \uADF8\uB0E5 \uB9CC\uD654 \uD615\uBC95\uD310\uB840 \uB4F1\uC744 \uCD94\uCC9C\uD574\uBCFC\uAE4C \uC0DD\uAC01 \uC911.",
