  "text" : "\"\uD615\uBC95\uC5D0 \uD765\uBBF8\uAC00 \uC788\uC5B4\uC694!\" \uB77C\uACE0 \uD574\uC11C \uB098\uB984 \uCC45\uC744 \uCD94\uCC9C\uD574\uB3C4, \uC2ED\uC911\uD314\uAD6C\uB294 \uD589\uC704\uB860\uC5D0\uC11C\uBD80\uD130 \uB9C9\uD788\uB2E4\uAC00 \uAD6C\uC131\uC694\uAC74\uB860\uC5D0\uC11C \uCC45\uC744 \uB193\uAC8C \uB418\uB294 \uD3B8\uC774\uB77C.. \uD615\uBC95\uC5D0 \uD765\uBBF8\uAC00 \uC788\uB2E4\uB294 \uBD84\uB4E4\uAED8\uB294 \uC785\uBB38\uC11C\uB97C \uCD94\uCC9C\uD558\uAE30\uAC00 \uC27D\uC9C0 \uC54A\uB2E4. \uD615\uBC95\uC774\uB77C\uBA74 \uB2E4\uB4E4 \uC0AC\uB840 \uB098\uC624\uACE0 \uADF8\uB7F0 \uAC83\uC744 \uAE30\uB300\uD558\uC2DC\uB2E4\uBCF4\uB2C8;",
