  "text" : "\uB09C \uADF8\uC800 \uB0B4\uAC00 \uB625\uC744 \uC2F8\uC9C0\uB97C \uACF5\uAC04\uC774 \uD544\uC694\uD560 \uBFD0\uC774\uB2E4. \uB0B4\uAC00 \uD0D0\uB77C\uC5D0 \uB625\uC744 \uC2F8\uAE30\uB97C \uAE30\uB2E4\uB838\uB2E4\uAC00, \uB530\uB048\uD55C \uB625\uC744 \uC2F8\uC9C0\uB974\uC790\uB9C8\uC790 \uAD73\uC774 \uCC14\uB7EC\uC11C \uBA39\uC5B4\uBCF8 \uB4A4\uC5D0 \uADF8 \uB9DB\uC744 \uD3C9\uAC00\uD558\uACE0, \uC790\uAE30\uB4E4\uB07C\uB9AC \uD6C4\uAE30\uB97C \uACF5\uC720\uD558\uB294 \uC0AC\uB78C\uB4E4\uC774 \uC65C \uC874\uC7AC\uD558\uB294\uC9C0\uC5D0 \uB300\uD574\uC11C\uB294 \uC774\uD574 \uBD88\uAC00.\n\n\uADF8\uAC78 \uC990\uACA8\uC694..?",
