  "text" : "'\uC2A4\uD0C0\uB2C8\uC2A4\uC640\uD504 J. \uB809'\uC774 \"\uC2EC\uC9C0\uC5B4 \uADF8\uC758 \uCE68\uBB35\uC5D0\uB3C4 \uBB38\uBC95\uC801\uC778 \uC2E4\uC218\uAC00 \uC788\uB2E4.\" \uB77C\uACE0 \uD588\uB358 \uAC83\uCC98\uB7FC- \uC791\uC815\uD558\uACE0 \uD2B8\uC9D1\uC744 \uC7A1\uC73C\uB824\uB294 \uC0AC\uB78C\uB4E4\uC5D0\uAC8C \uB0B4\uAC00 \uC54C\uB791\uBC29\uADC0\uB97C \uB00C\uAC70\uB098, \uC785\uB9DB\uC5D0 \uB9DE\uCDB0\uC8FC\uB824 \uB178\uB825\uC744 \uD560 \uD544\uC694\uAC00 \uBB50\uAC00 \uC788\uACA0\uB294\uAC00. \uB0B4\uAC00 \uADF8\uB4E4\uC744 \uC704\uD574 \uD2B8\uC717\uC744 \uD558\uB294 \uAC83\uC774 \uC544\uB2CC\uB370.",
