  "text" : "\uC774\uCC98\uB7FC '\uC7AC\uBBF8\uB294 \uC788\uC9C0\uB9CC, \uAD73\uC774 \uC0C1\uB300\uD560 \uAC00\uCE58\uAE4C\uC9C0\uB294 \uB290\uB07C\uC9C0 \uBABB\uD558\uACA0\uB294 \uC0AC\uB78C\uB4E4'\uC758 \uB208\uCE58\uB97C \uBCF4\uAE30 \uC704\uD574 \uB098\uC758 \uD2B8\uC717 \uC815\uCCB4\uC131\uC744 \uBC14\uAFD4\uC57C \uACA0\uB2E4\uB294 \uC0DD\uAC01\uC740 \uC804\uD600 \uD558\uC9C0 \uBABB\uD558\uACE0 \uC788\uB2E4. \uB0B4\uAC00 \uB9DE\uB294 \uC18C\uB9AC\uB97C \uD574\uB3C4 \uD2B8\uC9D1\uC744 \uC7A1\uACE0, \uC790\uAE30 \uD0D0\uB77C\uC5D0\uC11C \uC870\uC6A9\uD788 \uB514\uC2A4\uB97C \uD558\uACE0 \uC788\uB294 \uC0AC\uB78C\uB4E4\uC774\uB2C8\uAE4C.",
