  "text" : "\uB2E4\uB978 \uBD84\uB4E4\uC774 \uBCF4\uB0B4\uC624\uC2DC\uB294 \uBA58\uC158\uC774\uB098 \uBC18\uC751 \uB4F1\uC744 \uC77D\uC5B4\uB294 \uBCF4\uC9C0\uB9CC, \uADF8\uC5D0 \uB300\uD574 \uC801\uADF9\uC801\uC73C\uB85C \uBC18\uC751\uD558\uC9C0\uB294 \uC54A\uB294 \uD3B8.\n\n\uB0B4 \uD3B8(?)\uC744 \uB9CC\uB4E4\uC5B4\uC57C \uD55C\uB2E4\uB294 \uAC15\uBC15\uAC10\uB3C4 \uC5C6\uACE0, \uC870\uB9AC\uB3CC\uB9BC\uC744 \uC704\uD574 \uC138\uB97C \uD655\uC7A5(?)\uD558\uB824\uB294 \uC2DC\uB3C4\uB3C4 \uD558\uC9C0 \uC54A\uC558\uB2E4. \uB098 \uD63C\uC790\uC11C \uAE4C\uB294 \uAC83\uC73C\uB85C\uB3C4 \uB9CC\uC871\uC2A4\uB7EC\uC6E0\uC73C\uB2C8\uAE4C.",
