  "text" : "1\uCC28\uC801\uC73C\uB85C\uB294 \uC815\uC815\uC744 \uC694\uAD6C\uD588\uACE0, \uADF8\uAC8C \uD1B5\uD558\uC9C0 \uC54A\uC744 \uACBD\uC6B0\uC5D0\uB294 \uC2E0\uB784\uD558\uAC8C \uC800\uACA9\uC9C8\uC744 \uD574\uB314\uB2E4. \uADF8\uAC8C \uB0B4\uAC00 \uD2B8\uC717\uC744 \uD558\uB294 \uC774\uC720\uC600\uC73C\uBBC0\uB85C.\n\n\uC0AC\uC2E4 \uB098\uB294 \uD2B8\uC717\uC5D0\uC11C\uC758 \uCE5C\uBAA9 \uB4F1\uC5D0 \uB300\uD574\uC11C \uBCC4 \uAD00\uC2EC\uC774 \uC5C6\uB294 \uD3B8\uC774\uB2E4. \uB0B4 \uACC4\uC815\uC740 \uB0B4\uAC00 \uD558\uACE0 \uC2F6\uC740 \uB9D0\uC744 \uD22D \uB358\uC838\uB193\uB294 \uBC30\uC124\uAD6C\uC778\uC9C0\uB77C",
