  "text" : "\uB0B4 \uC9C1\uC5C5\uC774\uB098 \uC774\uB984 \uB4F1\uC744 \uBAA8\uB450 \uC228\uACA8\uC654\uAE30\uC5D0 \uB098\uB294 \uD2B8\uC704\uD130\uC5D0\uC11C \uB098\uC758 \uC758\uACAC\uC744 \uC790\uC720\uB86D\uAC8C \uAC1C\uC9C4\uD560 \uC218 \uC788\uC5C8\uACE0, \uD604\uC2E4\uC5D0\uC11C \uC81C\uB300\uB85C \uD45C\uD604\uD558\uC9C0 \uBABB\uD558\uB294 \uB098\uC758 \uAC10\uC815\uB4E4\uC744 \uC870\uAE08\uC774\uB098\uB9C8 \uC194\uC9C1\uD558\uAC8C \uD45C\uD604\uD560 \uC218 \uC788\uC5C8\uB2E4. \uD55C\uB9C8\uB514\uB85C \uB625\uC744 \uC2F8\uC9C0\uB974\uACE0 \uC2F6\uC744 \uB54C, \uBB35\uC9C1\uD558\uAC8C \uC2F8\uC9C0\uB97C \uC218 \uC788\uC5C8\uB2E8 \uB9D0\uC774\uB2E4.",
