  "text" : "\uC544\uB2CC \uAC83 \uAC19\uC73C\uBA74, \uC790\uAE30\uAC00 \uC798\uBABB \uC54C\uACE0 \uC788\uB294 \uAC83 \uAC19\uC73C\uBA74 \uAE54\uB054\uD558\uAC8C \uC778\uC815\uC744 \uD574\uC694. \uC65C \uAD6C\uCC28\uD558\uAC8C \uBED8\uC18C\uB9AC\uB97C \uB298\uC5B4\uB193\uC73C\uBA70 \uC0C1\uB300\uAE4C\uC9C0 \uC9C4\uD759\uD0D5\uC73C\uB85C \uB04C\uC5B4\uB4E4\uC774\uB098. \uC0C1\uB300\uAE4C\uC9C0 \uBED8\uC18C\uB9AC\uB97C \uD558\uAC8C \uB9CC\uB4E4\uC5B4\uC57C \uC815\uC2E0\uC2B9\uB9AC\uC5D0 \uB3C4\uC6C0\uC774 \uB418\uB098? \uD558\uAE34, \uD0C0\uC778\uC758 \uBD84\uB178\uB97C \uB300\uB738 \uBE44\uD310\uD558\uB294 \uC0AC\uB78C\uB4E4\uC774 \uC788\uC73C\uB2C8 \uBB50",
