  "text" : "\uC0DD\uD654\uD559\uBB34\uAE30\uB294 \uD575\uBB34\uAE30\uC5D0 \uBE44\uD574 \uC0AC\uC6A9\uC2DC \uAD6D\uC81C\uC801 \uBD80\uB2F4\uB3C4 \uC0C1\uB300\uC801\uC73C\uB85C \uC801\uACE0, \uC800\uB834\uD55C \uAC00\uACA9\uACFC \uD655\uC2E4\uD55C \uC0B4\uC0C1\uD6A8\uACFC, \uAC01\uC885 \uC2DC\uC124\uC758 \uC874\uC18D\uD6A8\uACFC\uB97C \uAC00\uC9C0\uACE0 \uC788\uAE30 \uB54C\uBB38\uC5D0 \uBD81\uD55C\uC73C\uB85C\uC11C\uB294 \uC808\uB300 \uBC84\uB9B4 \uC218\uB3C4 \uC5C6\uACE0, \uBC18\uB4DC\uC2DC \uC4F0\uAC8C \uB420 \uBB34\uAE30\uACA0\uC8E0.\n\n\uAC1C\uC804 \uC9C1\uC804\uC5D0 \uC804\uBC29\uC5D0 \uD1A1, \uC11C\uC6B8\uACFC \uC218\uB3C4\uAD8C\uC5D0 \uD1A1-",
