  "text" : "\uC0AC\uC2E4 \uBD81\uD55C\uC758 \uD575\uBB34\uAE30\uB294 \uC5B4\uB514\uAE4C\uC9C0\uB098 '\uBE14\uB7EC\uD551' \uC6A9\uC73C\uB85C \uBCF4\uC77C \uBFD0\uC774\uC9C0\uB9CC, \uBD81\uD55C\uC758 \uC0DD\uD654\uD559 \uBB34\uAE30\uB294 \uC815\uB9D0\uC774\uC9C0 '\uC2E4\uC874\uD558\uB294' \uC704\uD611\uC785\uB2C8\uB2E4. \uC2E4\uC81C\uB85C \uC0AC\uC6A9\uB420 \uC704\uD5D8\uC131\uB3C4 \uB192\uACE0\uC694. \uC790\uC8FC \uB4E3\uACE4 \uD558\uB294 '\uC11C\uC6B8\uC774 \uBD88\uBC14\uB2E4'\uAC00 \uB420 \uD655\uB960\uBCF4\uB2E4, \uC57D\uBB3C\uBC14\uB2E4\uAC00 \uB420 \uD655\uB960\uC774 \uB354 \uB192\uC544\uBCF4\uC774\uC9C0 \uB9D0\uC785\uB2C8\uB2E4..",
