  "text" : "RT @AskAKorean: \uACFC\uB300\uB9DD\uC0C1\uB3C4 \uD569\uB2C8\uB2E4. \uC774\uAC74 \uC8FC\uB85C \uAC00\uC815\uD3ED\uB825 \uC0C1\uD669\uC5D0\uC11C \uB9CE\uC774 \uBC1C\uC0DD\uD558\uACE0, \uB54C\uBB38\uC5D0 \uAC00\uC815\uD3ED\uB825\uC5D0\uC11C \uB098\uD0C0\uB098\uB294 \uC815\uB2F9\uBC29\uC704 \uC0AC\uAC74\uC5D0 \uB9CE\uC774 \uB4F1\uC7A5\uD569\uB2C8\uB2E4. \uD3ED\uB825\uD53C\uD574\uC99D\uD6C4\uAD70\uC774 \uC5B4\uB514\uAE4C\uC9C0 \uC801\uC6A9\uB420 \uC218 \uC788\uB294\uAC00\uB294 \uD06C\uAC8C \uB450 \uAC00\uC9C0 \uD328\uB7EC\uB2E4\uC784\uC774 \uC788\uC2B5\uB2C8\uB2E4. \uB450 \uD328\uB7EC\uB2E4\uC784\uC744\u2026",
