  "text" : "\uD53C\uD574\uC790\uAC00 \uD53C\uACE0\uC778\uC758 \uBC94\uD589\uC744 \uC720\uBC1C\uD55C \uCE21\uBA74\uC774 \uC874\uC7AC\uD558\uB294 \uC810, \uB2E4\uD589\uD788 \uC774 \uC0AC\uAC74 \uBC94\uD589\uC740 \uBBF8\uC218\uC5D0 \uADF8\uCCE4\uACE0, \uD53C\uD574\uC790\uB294 \uD2B9\uBCC4\uD55C \uBB38\uC81C\uC5C6\uC774 \uC0C1\uCC98\uB97C \uCE58\uC720\uD558\uC5EC \uD604\uC7AC \uC815\uC0C1\uC801\uC778 \uC0DD\uD65C\uC744 \uD558\uACE0 \uC788\uB294 \uAC83\uC73C\uB85C \uBCF4\uC774\uB294 \uC810 \uB4F1 \uC591\uD615\uC758 \uC870\uAC74\uC774 \uB418\uB294 \uC81C\uBC18 \uC0AC\uC815\uB4E4\uC744 \uACE0\uB824\uD558\uC5EC \uC704 \uAD8C\uACE0\uD615\uC758 \uBC94\uC704\uBCF4\uB2E4",
