  "text" : "\uC0AC\uC2E4 \uD53C\uD559\uB300\uC5EC\uC131\uC99D\uD6C4\uAD70 \uB610\uB294 \uD53C\uD559\uB300\uC544\uB3D9\uC99D\uD6C4\uAD70 \uB4F1\uC740 \uBC95\uC815\uC5D0\uC11C \uC5B8\uAE09\uB418\uB294 \uAC83\uC5D0 \uBE44\uD574 \uADF8\uB2E4\uC9C0 \uC798 \uC778\uC815\uB418\uC9C4 \uC54A\uB294 \uD3B8\uC774\uC608\uC694. \uC815\uB2F9\uBC29\uC704\uC758 \uC131\uB9BD\uC694\uAC74\uC744 \uADF9\uD788 \uC881\uAC8C \uD574\uC11D\uD558\uB294 \uD55C\uAD6D \uC0AC\uBC95\uBD80\uB294 \uC774\uB7EC\uD55C \uC815\uC2E0\uAC10\uC815\uC11C\uB97C \uC774\uC720\uB85C \uC815\uB2F9\uBC29\uC704\uB098 \uACFC\uC789\uBC29\uC704, \uAE34\uAE09\uD53C\uB09C \uB4F1\uC744 \uC778\uC815\uD55C \uBC14\uB3C4 \uC5C6\uAD6C\uC694.",
