  "text" : "\uD55C\uAD6D\uC5D0\uC11C\uB3C4 1990\uB144\uB300 \uC774\uD6C4\uBD80\uD130 \uC774 \uD53C\uD559\uB300\uC5EC\uC131\uC99D\uD6C4\uAD70\uC744 \uAF64\uB098 \uC801\uADF9\uC801\uC73C\uB85C \uD65C\uC6A9\uD558\uAE30 \uC2DC\uC791\uD588\uACE0, \uBA85\uCE6D\uC740 \uB2E4\uB974\uC9C0\uB9CC(PTSD, \uC6B0\uC6B8\uC99D, \uB9E4 \uB9DE\uB294 \uC544\uB0B4 \uC99D\uD6C4\uAD70, \uD559\uB300\uBC1B\uB294 \uC5EC\uC131 \uC99D\uD6C4\uAD70, \uD559\uB300\uB85C \uC778\uD55C \uC77C\uC2DC\uC801 \uC911\uC99D \uC815\uC2E0\uC7A5\uC560 \uB4F1) \uBC95\uC815\uC5D0 \uAF64 \uC790\uC8FC \uB4F1\uC7A5\uD558\uAE30 \uC2DC\uC791\uD569\uB2C8\uB2E4.",
