  "text" : "\uC2EC\uB9AC\uD559\uACC4\uC640 \uC815\uC2E0\uC758\uD559\uACC4 \uCE21\uC5D0\uC11C\uB294 '\uD53C\uD559\uB300\uC5EC\uC131\uC99D\uD6C4\uAD70'\uC744 \uC2E0\uB784\uD558\uAC8C \uBE44\uD310\uD558\uACE0 \uBD80\uC815\uD55C\uB2E4\uACE0 \uD558\uB294\uB370, \uBC95\uD559\uACC4 \uCE21\uC5D0\uC11C\uB294 \uC720\uB09C\uD788 \uC774 \uD53C\uD559\uB300\uC5EC\uC131\uC99D\uD6C4\uAD70\uC744 \uC9C0\uC9C0\uD558\uACE0 \uBC29\uC5B4\uB17C\uB9AC\uB85C \uD65C\uC6A9\uD558\uB294 \uD3B8. (\uC0AC\uC2E4 '\uD53C\uD559\uB300\uC5EC\uC131\uC99D\uD6C4\uAD70' \uB9CC\uD07C \uC7AC\uD310\uBD80\uC640 \uBC30\uC2EC\uC6D0\uB2E8\uC5D0\uAC8C \uC798 \uBA39\uD788\uB294 \uC0AC\uC720\uB3C4 \uD754\uCE58 \uC54A\uC8E0)",
